BEGIN TRANSACTION;

CREATE TABLE "Users"
(
    "ID"		UUID PRIMARY KEY,
    "Username"	TEXT NOT NULL,
    "Password"	TEXT NOT NULL,
    "isActive"	BOOLEAN NOT NULL DEFAULT FALSE
);
CREATE TABLE IF NOT EXISTS "Income" (
	"ID"		SERIAL PRIMARY KEY,
	"UserID" 	UUID NOT NULL,
	"Amount"	NUMERIC(10,2),
	"Source"	TEXT,
	"Type"		TEXT,
	"DateTime"	DATE,
	"Comment"	TEXT DEFAULT NULL,
	"Hours"		NUMERIC(10,2),
	CONSTRAINT fk_userid
      FOREIGN KEY("UserID")
        REFERENCES "Users"("ID")
);
CREATE TABLE IF NOT EXISTS "Bills" (
	"ID"	SERIAL PRIMARY KEY,
	"UserID" 	UUID NOT NULL,
	"Amount"	NUMERIC(10,2),
	"Medium"	TEXT,
	"DateTime"	DATE,
	"Comment"	TEXT DEFAULT NULL,
	CONSTRAINT fk_userid
      FOREIGN KEY("UserID")
        REFERENCES "Users"("ID")
);
CREATE TABLE IF NOT EXISTS "ProductTypes" (
	"ID"		SERIAL PRIMARY KEY,
	"UserID" 	UUID NOT NULL,
	"Type"		TEXT NOT NULL,
	"Comment"	TEXT DEFAULT NULL,
	"Priority"	INTEGER NOT NULL DEFAULT 51,
	CONSTRAINT fk_userid
      FOREIGN KEY("UserID")
        REFERENCES "Users"("ID")
);
CREATE TABLE IF NOT EXISTS "Products" (
	"ID"		SERIAL PRIMARY KEY,
	"UserID" 	UUID NOT NULL,
	"Product"	TEXT NOT NULL,
	"TypeID"	BIGINT,
	"Comment"	TEXT DEFAULT NULL,
	"Priority"	INTEGER NOT NULL DEFAULT 2,
	CONSTRAINT fk_userid
      FOREIGN KEY("UserID")
        REFERENCES "Users"("ID"),
	CONSTRAINT fk_typeid
      FOREIGN KEY("TypeID")
        REFERENCES "ProductTypes"("ID")
);
CREATE TABLE IF NOT EXISTS "Expenditures" (
	"ID"		SERIAL PRIMARY KEY,
	"UserID" 	UUID NOT NULL,
	"DateTime"	DATE,
	"ProductID"	BIGINT,
	"Amount"	NUMERIC(10,2),
	"Comment"	TEXT DEFAULT NULL,
	"isCash"	BOOLEAN DEFAULT FALSE,
	CONSTRAINT fk_userid
      FOREIGN KEY("UserID")
        REFERENCES "Users"("ID"),
	CONSTRAINT fk_typeid
      FOREIGN KEY("ProductID")
        REFERENCES "Products"("ID")
);
CREATE TABLE IF NOT EXISTS "AccountData" (
	"AccountID" INTEGER,
	"UserID" 	UUID NOT NULL,
	"Data księgowania"	DATE,
	"Data operacji"	DATE,
	"Tytuł operacji"	TEXT,
	"Dane strony operacji"	TEXT,
	"Rachunek strony operacji"	TEXT,
	"Kwota"	NUMERIC(10,2),
	"Saldo"	NUMERIC(10,2),
	"Pozycje historii"	INTEGER PRIMARY KEY,
	CONSTRAINT fk_userid
      FOREIGN KEY("UserID")
        REFERENCES "Users"("ID")
);
CREATE TABLE IF NOT EXISTS "ExpendituresTransitory" (
	"ID"	SERIAL PRIMARY KEY,
	"UserID" 	UUID NOT NULL,
	"DateTime"	DATE,
	"Product"	TEXT NOT NULL,
	"Amount"	NUMERIC(10,2),
	"Comment"	TEXT DEFAULT NULL,
	"isCash"	BOOLEAN DEFAULT FALSE,
	CONSTRAINT fk_userid
      FOREIGN KEY("UserID")
        REFERENCES "Users"("ID")
);
CREATE TABLE IF NOT EXISTS "UserSettings" (
	"UserID" 	UUID NOT NULL,
	"Setting"	TEXT NOT NULL,
	"Value"	TEXT NOT NULL,
	PRIMARY KEY("Setting","UserID"),
	CONSTRAINT fk_userid
      FOREIGN KEY("UserID")
        REFERENCES "Users"("ID")
);
CREATE TABLE IF NOT EXISTS "AccountDataImport" (
	"field1"	TEXT,
	"field2"	TEXT,
	"field3"	TEXT,
	"field4"	TEXT,
	"field5"	TEXT,
	"field6"	TEXT,
	"field7"	TEXT,
	"field8"	INTEGER,
	"field9"	TEXT
);





CREATE VIEW "MonthlyBills" AS
SELECT
	"UserID"
	,SUBSTRING(TO_CHAR("DateTime", 'YYYY-MM-DD'), 1, 7) AS "Month"
	,ROUND(SUM("Amount"), 2)                            AS "Amount"
FROM 	"Bills"
GROUP BY "UserID", "Month"
ORDER BY "UserID", "Month";
CREATE VIEW "MonthlyIncome" AS
SELECT
	"UserID"
	,SUBSTRING(TO_CHAR("DateTime", 'YYYY-MM-DD'), 1, 7) AS "Month"
	,ROUND(SUM("Amount"),2)                             AS "Amount"
FROM 	"Income"
GROUP BY "UserID", "Month"
ORDER BY "UserID", "Month";
CREATE VIEW "MonthlyIncomeByType" AS
SELECT 
	"UserID",
	SUBSTRING(TO_CHAR("DateTime", 'YYYY-MM-DD'), 1, 7)				as "Month"
	,ROUND(SUM("Amount"),2)					as "Amount"
	,"Type"									as "Type"
FROM 	"Income"
GROUP BY "UserID", "Month", "Type"
ORDER BY "UserID", "Month";
CREATE VIEW "MonthlyIncomeBySource" AS
SELECT 
	"UserID"
	,SUBSTRING(TO_CHAR("DateTime", 'YYYY-MM-DD'), 1, 7)				as "Month"
	,ROUND(SUM("Amount"),2)					as "Amount"
	,"Source"								as "Source"
FROM 	"Income"
GROUP BY "UserID", "Month", "Source"
ORDER BY "UserID", "Month";
CREATE VIEW "IncomeSummaryByType" AS
SELECT
	"Income"."UserID"						AS "UserID"
	,"Income"."Type"						AS "Type"
	,COALESCE("Summary"."Amount", 0)		AS "Amount"
	,COALESCE("Summary"."Times", 0)	    	AS "Times"
	,"Summary"."First"						AS "First"
	,"Summary"."Last"						AS "Last"
	,COALESCE("Summary"."Common", 'Absent')	AS "Common"
FROM "Income"
LEFT JOIN (SELECT 
	*
	,(CASE WHEN ("Times">(
					SELECT 
						AVG("Times") AS "Average" 
					FROM (	SELECT
							   "UserID"
							   ,"Type"
							   ,Round(SUM("Amount"), 2)							AS "Amount"
							   ,COUNT(TO_CHAR("DateTime", 'YYYY-MM-DD'))		AS "Times"
							   ,MAX(TO_CHAR("DateTime", 'YYYY-MM-DD'))			AS "Last"
							   ,MIN(TO_CHAR("DateTime", 'YYYY-MM-DD'))			AS "First"
							FROM "Income"
							GROUP BY "Type", "UserID"
							ORDER BY "Type" DESC)))
	then 'Common' else 'Uncommon' end) AS "Common"
FROM (	SELECT
		   "UserID"
		   ,"Type"
		   ,Round(SUM("Amount"), 2)	AS "Amount"
		   ,COUNT(TO_CHAR("DateTime", 'YYYY-MM-DD'))		AS "Times"
		   ,MAX("DateTime")			AS "Last"
		   ,MIN("DateTime")			AS "First"
		FROM "Income"
		GROUP BY "Type", "UserID"
		ORDER BY "Times" DESC))
AS "Summary"
ON "Income"."Type"="Summary"."Type"
AND "Income"."UserID"="Summary"."UserID"
GROUP BY "Income"."UserID",
		 "Income"."Type",
		 "Summary"."Amount",
		 "Summary"."Times",
		 "Summary"."First",
		 "Summary"."Last",
		 "Summary"."Common"
ORDER BY "Times" DESC;
CREATE VIEW "MonthlyBillsByMedium" AS
SELECT 
	"UserID"
	,SUBSTRING(TO_CHAR("DateTime", 'YYYY-MM-DD'), 1, 7)				as "Month"
	,ROUND(SUM("Amount"), 2)				as "Amount"
	,"Medium"								as "Medium"
FROM 	"Bills"
GROUP BY "UserID", "Month", "Medium"
ORDER BY "UserID", "Month";
CREATE VIEW "ExpendituresEnriched" AS
	SELECT	"Expenditures"."UserID"				AS "UserID",
			"Expenditures"."ID"					AS "ID",
			"Expenditures"."DateTime"		  	AS "DateTime",
			"Expenditures"."Amount"				AS "Amount",
			"Products"."Product"				AS "Product",
			"ProductTypes"."Type"				AS "Type",
			(CASE WHEN 
				("Expenditures"."isCash"=FALSE)
			THEN 'NO' ELSE 'YES' END)			AS "Cash",
			"Expenditures"."Comment"			AS "Comment",
			"Products"."Priority"				AS "ProductPriority",
			"ProductTypes"."Priority"			AS "TypePriority"
	FROM 		"Expenditures"
	LEFT JOIN	"Products"
		ON	"Expenditures"."ProductID"="Products"."ID"
		AND	"Expenditures"."UserID"="Products"."UserID"
	LEFT JOIN 	"ProductTypes"
		ON	"Products"."TypeID"="ProductTypes"."ID"
		AND	"Products"."UserID"="ProductTypes"."UserID"
	ORDER BY "DateTime";
CREATE VIEW "MonthlyBilance" AS 
SELECT 
	"UserID"
	,TO_CHAR("DateTime", 'YYYY-MM') 	AS "Month"
	,ROUND(SUM("Amount"), 2) 			AS "Amount"
	,"Source"							AS "Source"
	--Previous_month_income - (bills + expenditures)
FROM(SELECT 
			"UserID"
			,"DateTime"											AS "DateTime"
			,"Amount" 										  	AS "Amount"
			,'Income'										  	AS "Source"
			FROM "Income"
	 UNION SELECT
			"UserID"
			,"DateTime"										  	AS "DateTime" 
			,-("Amount") 									  	AS "Amount"
			,'Expenditures'									  	AS "Source"
			FROM "ExpendituresEnriched"
	 UNION SELECT
			"UserID"
			,"DateTime"										  	AS "DateTime" 
			,-("Amount") 									  	AS "Amount"
			,'Bills'									  	  	AS "Source"
			FROM "Bills")
GROUP BY "Month", "Source", "UserID"
ORDER BY "UserID", "Month" ASC;
CREATE VIEW "MonthlyBilanceSingle" AS
SELECT 
	"UserID"
	,"Month"					AS "Month"
	,ROUND(SUM("Amount"),2)	AS "Amount"
FROM "MonthlyBilance"
GROUP BY "UserID", "Month"
ORDER BY "UserID", "Month" ASC;
CREATE VIEW "MonthlyCharge" AS
SELECT
	--"Year"
	"UserID"
	,"Month"
	,"Charge"
FROM (SELECT --TO_CHAR("DateTime", 'YYYY') AS "Year",
			 "UserID"
			 ,TO_CHAR("DateTime", 'YYYY-MM')         AS "Month"
			 ,ROUND((SUM("Amount")/SUM("Hours")), 2) AS "Charge"
	   FROM "Income"
	   WHERE "Type" IN ('Praca', 'Premia')
	   GROUP BY "UserID", "Month"
	   ORDER BY "UserID", "Month")
WHERE "Charge" IS NOT NULL;
